import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { Copy, CheckCircle } from 'lucide-react';

const DemoResetLink = () => {
  const [resetData, setResetData] = useState(null);
  const [copied, setCopied] = useState(false);

  useEffect(() => {
    const storedData = localStorage.getItem('passwordResetData');
    if (storedData) {
      try {
        setResetData(JSON.parse(storedData));
      } catch (error) {
        console.error('Error parsing reset data:', error);
      }
    }
  }, []);

  const copyToClipboard = async (text) => {
    try {
      await navigator.clipboard.writeText(text);
      setCopied(true);
      setTimeout(() => setCopied(false), 2000);
    } catch (error) {
      console.error('Failed to copy:', error);
    }
  };

  if (!resetData) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-50 to-indigo-100 py-12 px-4 sm:px-6 lg:px-8">
        <div className="max-w-md w-full space-y-8">
          <div className="text-center">
            <h2 className="text-2xl font-bold text-gray-900 mb-2">
              No Reset Token Found
            </h2>
            <p className="text-gray-600 mb-6">
              Please request a password reset first to see the demo token.
            </p>
            <Link
              to="/forgot-password"
              className="inline-flex items-center justify-center w-full px-4 py-2 text-sm font-medium text-white bg-primary-600 border border-transparent rounded-md hover:bg-primary-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500"
            >
              Request Password Reset
            </Link>
          </div>
        </div>
      </div>
    );
  }

  const resetUrl = `${window.location.origin}/reset-password/${resetData.token}`;
  const expiresAt = new Date(resetData.expiresAt);

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-50 to-indigo-100 py-12 px-4 sm:px-6 lg:px-8">
      <div className="max-w-2xl w-full space-y-8">
        <div className="text-center">
          <h2 className="text-3xl font-bold text-gray-900 mb-2">
            Demo Password Reset Link
          </h2>
          <p className="text-gray-600 mb-6">
            This is a demo of the password reset functionality. In a real application, this link would be sent via email.
          </p>
        </div>

        <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-6 space-y-6">
          <div>
            <h3 className="text-lg font-medium text-gray-900 mb-2">Reset Information</h3>
            <div className="space-y-2 text-sm">
              <p><strong>Email:</strong> {resetData.email}</p>
              <p><strong>Token:</strong> {resetData.token}</p>
              <p><strong>Expires:</strong> {expiresAt.toLocaleString()}</p>
              <p><strong>Status:</strong> 
                <span className={`ml-2 px-2 py-1 rounded-full text-xs font-medium ${
                  expiresAt > new Date() 
                    ? 'bg-green-100 text-green-800' 
                    : 'bg-red-100 text-red-800'
                }`}>
                  {expiresAt > new Date() ? 'Valid' : 'Expired'}
                </span>
              </p>
            </div>
          </div>

          <div>
            <h3 className="text-lg font-medium text-gray-900 mb-2">Reset URL</h3>
            <div className="flex items-center space-x-2">
              <input
                type="text"
                value={resetUrl}
                readOnly
                className="flex-1 px-3 py-2 border border-gray-300 rounded-md text-sm bg-gray-50"
              />
              <button
                onClick={() => copyToClipboard(resetUrl)}
                className="px-3 py-2 text-sm font-medium text-gray-700 bg-white border border-gray-300 rounded-md hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500"
              >
                {copied ? (
                  <CheckCircle className="h-4 w-4 text-green-600" />
                ) : (
                  <Copy className="h-4 w-4" />
                )}
              </button>
            </div>
          </div>

          <div className="flex space-x-4">
            <Link
              to={resetUrl}
              className="flex-1 inline-flex items-center justify-center px-4 py-2 text-sm font-medium text-white bg-primary-600 border border-transparent rounded-md hover:bg-primary-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500"
            >
              Test Reset Link
            </Link>
            <button
              onClick={() => {
                localStorage.removeItem('passwordResetData');
                setResetData(null);
              }}
              className="flex-1 inline-flex items-center justify-center px-4 py-2 text-sm font-medium text-gray-700 bg-gray-100 border border-gray-300 rounded-md hover:bg-gray-200 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-500"
            >
              Clear Token
            </button>
          </div>
        </div>

        <div className="text-center">
          <Link
            to="/login"
            className="text-primary-600 hover:text-primary-500 text-sm font-medium"
          >
            Back to Login
          </Link>
        </div>
      </div>
    </div>
  );
};

export default DemoResetLink;
